import RegisterForm from "../form/RegisterForm";
import { Navbar, Nav, Link } from "react-bootstrap";
function Navbar1() {
  return (
    <div className="container-fluid w-100 ">
      <Navbar bg="dark" variant="dark ">
        <Navbar.Brand href="#home">מחברת מתכונים</Navbar.Brand>
        <Nav href="#home" className="m-3 text-white">
          כל מתכונים
        </Nav>
        <Nav className="mr-auto">
          <Nav.Link href="/sign-up">הרשמה</Nav.Link>
          <Nav.Link href="/login">התחברות</Nav.Link>
          <Nav.Link href="/gallery">גלריה</Nav.Link>
          <Nav.Link href="/new-recipe">מתכון חדש</Nav.Link>
        </Nav>
      </Navbar>
    </div>
  );
}

export default Navbar1;
